import React from "react";
import { a } from "react-router-dom";

const Nav = (props) => {
  return (
    <ul>
      <li>
        <a onClick={window.open("/src/components/Data")}>{props.data}</a>
      </li>
    </ul>
  );
};

export default Nav;
